def bubble_sort(unsorted_list):
    n = len(unsorted_list)
    count = 0

    for i in range(n):
        for a in range(0, n-1):
            count = count+1

            if unsorted_list[a] > unsorted_list[a+1]:
                unsorted_list[a], unsorted_list[a+1] = unsorted_list[a+1], unsorted_list[a]

    return unsorted_list, count



